import React from "react";
import '../css/Home.css';

import SignIn from "./SignIn";
import SignUp from "./SignUp";

class Home extends React.Component {

    constructor() {
        super();
    }


    render() {

        let home=<SignUp/>
        if(this.state.login){
            home=<SignIn/>
        }


        return (
            <div>
                {home}
            </div>

            );
        }
    }

    export default Home
